import { ADDTASK, DELETETASK, EDITTASK,  FINISHTASK } from "./actiontype"

export const addtodo=(todo)=>
{
    
type:ADDTASK;
payload: todo
  
}

export const edittodo=(edit)=>
{
type:EDITTASK
payload:edit
}


export const deletetodo=(del)=>
{   
type:DELETETASK
payload:del
}

export const finshtodo=(finish)=>
{
    type:FINISHTASK;
    payload:finish
}
